import React from 'react'
import jwt_decode from 'jwt-decode';
import axios from 'axios';
import Fetch from 'react-fetch'
import { CookiesProvider,useCookies,Cookies } from 'react-cookie';
import { Route, Link, Switch, Redirect,browserHistory } from 'react-router-dom';
import Indexx from './Indexx';
const cookies = new Cookies();
class Userlist extends React.Component{
    constructor(props){
        super(props)
        const GCC=cookies.get('name');
        const token=localStorage.getItem("token")
        let loginn=true;
        if(token == null){
            loginn=false
        }
        this.state={
            getlist:[],
            loginn
        }
    }
    componentDidMount(){
        this.getlistfun();
    }
    // getlistfun = _ =>{
    //     axios.get('http://localhost:5000/getlist')
    //     .then(response=>response.json())
    //     .then(response => this.setState({ getlist: response.data }))
    //     .then(({data}) =>{ console.log(data)})
    //     .catch(e=>console.log(e));
    // }
    getlistfun = () =>{
        axios.get('http://localhost:5000/getlist')
        .then((response)=>{
           const data = response.data; 
           this.setState({ getlist: data });
           console.log("getdata");
        });
    }
    //rendergetlist=({ex_id,name})=><div key={ex_id}>{name}</div>
    rendergetlist=()=>{
        if(!getlist.length) return null;
        return getlist.map((post,index)=>{
          <div key={index}>{post.name}</div>
        });
    }
    views = ()=>{
         if(!this.state.getlist.length) return null;
         return this.state.getlist.map((post,index)=>(
                   <table class="table table-striped" id="mytable">
                        <thead>
                            <tr>
                                <th>S.no</th>
                                <th>Name</th>
                                <th>Contact</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr key={index}>
                                <td>{post.ex_id}1</td>
                                <td>{post.name}</td>
                                <td>{post.contact}</td>
                            </tr>
                        </tbody>
                    </table>
         ));
    }
    close = ()=>{
        cookies.remove('name');
        localStorage.removeItem("token")
        this.props.history.push('/start');
    }
    render(){
        if(this.state.loginn === false) {
            return <Redirect to="/start" />
        }
        //const {rendergetlist}=this.state;
        return(
            <body>
                <div>
                   {/* {this.views(getlist)} */}
                   {/* {rendergetlist.map(this.state.getlist)} */}
                </div>
                <div class="container"><br />
                    <button class="btn btn-danger" onClick={this.close}>Close</button>
                    <h2>Details</h2>
                    <table class="table table-striped" id="mytable">
                        <thead>
                            <tr>
                                <th>S.no</th>
                                <th>Name</th>
                                <th>Source</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>lakk</td>
                                <td>098765432</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </body>
        );
    }
}
export default Userlist;
